Live Laugh Love Sign which is created from extremely high quality 16 gauge steel in Chesterfield, MI. This product can be left as bare polished steel or painted with a high quality Metal Finishing paint enamel in a variety of colors. 

This product is waterproof and can be used both indoors and out.  Made from only high quality materials, this product is designed to last for generations. 

Sizes are approximetaly:
- 16&quot; x 12&quot;
- 18&quot; x 13.5&quot;
- 24&quot; x 18&quot;
- 30&quot; x 22.5&quot;
- 36&quot; x 27&quot;

*Please note*
-Due to the nature of the process this piece may contain sharp edges.  Please take caution when handling.

Please do not hesitate to reach out to us with any questions or concerns that you might have. We again want to thank you for choosing JPMCustomMetal to create your custom piece.
